import React from 'react';
import Header from '../header'
import { Input, Select, Icon, Col, Row, InputNumber, DatePicker, AutoComplete, Cascader } from 'antd';
import 'antd/dist/antd.css';

const InputGroup = Input.Group;
const { Option } = Select;

const options = [
  {
    value: 'zhejiang',
    label: 'Zhejiang',
    children: [
      {
        value: 'hangzhou',
        label: 'Hangzhou',
        children: [
          {
            value: 'xihu',
            label: 'West Lake',
          },
        ],
      },
    ],
  },
  {
    value: 'jiangsu',
    label: 'Jiangsu',
    children: [
      {
        value: 'nanjing',
        label: 'Nanjing',
        children: [
          {
            value: 'zhonghuamen',
            label: 'Zhong Hua Men',
          },
        ],
      },
    ],
  },
];

const AddUser = () => {
  return <>
  <Header />
  <div className='container col-md-3'>

  <div style={{ marginBottom: 16 }}>
    <Input addonBefore="id"  defaultValue="" />
  </div>

  <div style={{ marginBottom: 16 }}>
    <Input addonBefore="User Name"  defaultValue="" />
  </div>


  <div style={{ marginBottom: 16 }}>
    <Input addonBefore="Password"  defaultValue="" />
  </div>


  <div style={{ marginBottom: 16 }}>
    <Input addonBefore="Mobile Number"  defaultValue="" />
  </div>


  <div style={{ marginBottom: 16 }}>
    <Input addonBefore="Role id"  defaultValue="" />
  </div>

  <InputGroup compact>
          <Cascader style={{ width: '100%' }} options={options} placeholder="Select Status" />
        </InputGroup>

  </div>
  </>
}

export default AddUser;
